    return (
        <div>
            <Container>
                <Row>
                    <Col>
                        <Row className="myName">Iâ€™m Karan Ghai</Row>
                        <Row className="myDesc">Software Developer</Row>
                        <Row><button className="btnHire" onClick={handleRoute}>Hire Me</button></Row>
                    </Col>
                    <Col><img className="zoom" src="/me.png" alt="profile_pic" /></Col>
                </Row>
                <Row>
                    <Col>CONTACT ME</Col>
                    <Col className="social">
                        <a href="#" className="fa fa-facebook"></a>
                        <a href="#" className="fa fa-snapchat-ghost"></a>
                        <a href="#" className="fa fa-linkedin"></a>
                        <a href="#" className="fa fa-instagram"></a>
                    </Col>
                </Row>
            </Container>
        </div>
    );
}

export default Home;
